  false,\n\t\"url\": null,\n\t\"notes\": \"This archival package contains global and
  regional mean sea level time series and trend maps calculated on a continual basis
  since December 1992 by Laboratory for Satellite Altimetry (LSA), Center for Satellite
  Applications and Research (STAR), NESDIS/NOAA. They are based on data from the series
  of reference missions (TOPEX/Poseidon, Jason-1 and Jason-2) that provide global
  mean sea level about every ten days with an uncertainty of 2-4 mm. In addition,
  estimates of mean sea level are also calculated from other satellite altimeter missions,
  including Geosat Follow-on, Envisat, ERS-1, and ERS-2. Sea Level Rise homepage at
  LSA: http://www.star.nesdis.noaa.gov/sod/lsa/SeaLevelRise\",\n\t\"license_title\":
